import { NavLink } from "react-router-dom";
import { Button } from "@material-ui/core";
const NavBtn = () => {
  return (
    <>
      <Button color="inherit" to="/">
        Home
      </Button>
      <Button color="inherit" exact component={NavLink} to="/about">
        About
      </Button>
      <Button color="inherit" exact component={NavLink} to="/contact">
        Contact
      </Button>
    </>
  );
};
export default NavBtn;
